guyDirection: .word 0
shiftDelay: .word 4


.text
.globl main
main: 

draw_start_screen:li $t0, BASE_ADDRESS      
            la $t1, STARTSCREEN    
            li $t2, 0          
            li $t3, NUM_UNITS
loop_start_screen: bge $t2, $t3, next_start
            sll $t4, $t2, 2         
            add $t5, $t1, $t4     
            lw $t5, 0($t5)       
            add $t4, $t4, $t0  
            sw $t5, 0($t4) 
            addi $t2, $t2, 1 
            j loop_start_screen

next_start:
	li $s0, startCursorX
	li $s1, startCursorY
	la $a0,CURSOR
	li $a1,CURSOR_SIZE
	jal drawCursorAt

cursor_while:  
	la $a0, STARTSCREEN
	li $a1, CURSOR_SIZE     
        jal restoreCursorAt
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	beq $t8, 1, key_happened_cursor
cursor_loop:
	la $a0, CURSOR
        li $a1, CURSOR_SIZE
 	jal drawCursorAt
 	li $v0, 32
	li $a0, 300
	syscall
	j cursor_while

key_happened_cursor:
	lw $t2, 4($t9)
	beq $t2, 0x61, handle_cursor_a
	beq $t2, 0x64, handle_cursor_d
	beq $t2, 0x78, handle_cursor_x
	beq $t2, 0x77, handle_cursor_w
	beq $t2, 0x73, handle_cursor_s
	j cursor_loop

exit_main: li $v0, 10
	syscall
	
handle_cursor_a:
	move $t0, $s2
	addi $t0, $t0, -8
	li $t1, LENGTH
	div $t0, $t1
	mfhi $t0
	beq $t0, $0, cursor_loop
	addi $s0, $s0, -3
	j cursor_loop
handle_cursor_d:
	move $t0, $s2
	addi $t0, $t0, 32
	li $t1, LENGTH
	div $t0, $t1
	mfhi $t0
	beq $t0, $0, cursor_loop
	addi $s0, $s0, 3
	j cursor_loop
handle_cursor_x:
	move $t0, $s2
	addi $t0, $t0, 1792
	li $t1, BASE_ADDRESS
	addi $t1, $t1, LAST_UNIT
	sub $t0, $t0, $t1
	bgt $t0, $0, cursor_loop
	addi $s1, $s1, 3
	j cursor_loop
handle_cursor_w:
	move $t0, $s2
	addi $t0, $t0, -512
	li $t1, BASE_ADDRESS
	sub $t0, $t0, $t1
	blt $t0, $0, cursor_loop
	addi $s1, $s1, -3
	j cursor_loop
handle_cursor_s:
	la $a0, STARTSCREEN
	li $a1, CURSOR_SIZE     
        jal restoreCursorAt
	lw $t0, 0($s2)
	beq $t0, CURSOR_GREEN1, draw_main_screen
	beq $t0, CURSOR_GREEN2, draw_main_screen
	beq $t0, CURSOR_RED1, clear_screen_end
	beq $t0, CURSOR_RED2, clear_screen_end
	j cursor_loop
 

draw_main_screen:
	li $t0, BASE_ADDRESS      
        la $t1, SCREEN1    
        li $t2, 0          
        li $t3, NUM_UNITS

loop_main_screen: 
	bge $t2, $t3, next_main
        sll $t4, $t2, 2         
        add $t5, $t1, $t4     
        lw $t5, 0($t5)       
        add $t4, $t4, $t0  
        sw $t5, 0($t4) 
        addi $t2, $t2, 1 
        j loop_main_screen

next_main:	
       	li $s0, 0
	li $s1, 0
	la $a0, HEART
	li $a1, 20
	jal drawHeartAt
	li $s0, 7
	li $s1, 0
	la $a0, HEART
	li $a1, 20
	jal drawHeartAt
	li $s0, 14
	li $s1, 0
	la $a0, HEART
	li $a1, 20
	jal drawHeartAt
	       
restart_main:
	li $s0, startX
	li $s1, startY
	la $t0, gravityDelay
	lw $s7, 0($t0)
 	
main_while:  
	la $a0, SCREEN1
	li $a1, GUY_SIZE       
        jal restoreGuyAt
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	beq $t8, 1, key_happened
	subi $s7, $s7, 1
	beq $s7, $0, guy_gravity
	j main_loop
	
guy_gravity:
	la $t0, gravityDelay
	lw $s7, 0($t0)
	addi $t0, $s3, 256
	lw $t0, 0($t0)
	bne $t0, ROOM, main_loop
	addi $t0, $s3, 260
	lw $t0, 0($t0)
	bne $t0, ROOM, main_loop
	addi $s1, $s1, 1
	la $t0, guyFloorChange
 	lw $t1, 0($t0)
 	addi $t1, $t1, 1
 	sw $t1, 0($t0)

main_loop:
	la $a0, GUY_RIGHT
        li $a1, GUY_SIZE
 	jal drawGuyAt
 	la $t0, guyFloorChange
 	lw $t0, 0($t0)
 	li $t1, 6
 	bne $t1, $t0, next
 	la $t0, guyFloorCount
 	lw $t1, 0($t0)
 	addi $t1, $t1, 1
 	sw $t1, 0($t0)
 	la $t0, guyFloorChange
 	sw $0, 0($t0)
 	la $t0, guyDirection
	li $t1, 1
 	sw $t1, 0($t0)
 	j continue
 	
 next:	li $t1, -6
 	bne $t1, $t0, continue
 	la $t0, guyFloorCount
 	lw $t1, 0($t0)
 	addi $t1, $t1, -1
 	sw $t1, 0($t0)
 	la $t0, guyFloorChange
 	sw $0, 0($t0)
	la $t0, guyDirection
	li $t1, -1
 	sw $t1, 0($t0)
	
continue:
	la $t0, shiftDelay
	lw $t1, 0($t0)
	subi $t1, $t1, 1
	sw $t1, 0($t0)
	beq $t1, $0, shiftEnemies
	jal drawEnemies
 	la $t0, guyDirection
 	sw $0, 0($t0)
	j main_while

shiftEnemies:
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	la $t0, guyFloorCount
	lw $t0, 0($t0)
	li $t1, 2
	ble $t0, $t1, level1_shift
	j shift_levels
	
level1_shift:
	la $t0, enemyX
	la $t1, enemyDirection
	li $t3, 0
	sll $t2, $t3, 2
	add $t3, $t2, $t0
	lw $t3, 0($t3)
	add $t4, $t2, $t1
	lw $t4, 0($t4)
	move $a0, $t3
	move $a1, $t4
	jal shiftXY
	move $t3, $v0
	move $t4, $v1
	add $t5, $t0, $t2
	add $t6, $t1, $t2
	sw $t3, 0($t5)
	sw $t4, 0($t6)
	li $t3, 1
	sll $t2, $t3, 2
	add $t3, $t2, $t0
	lw $t3, 0($t3)
	add $t4, $t2, $t1
	lw $t4, 0($t4)
	move $a0, $t3
	move $a1, $t4
	jal shiftXY
	move $t3, $v0
	move $t4, $v1
	add $t5, $t0, $t2
	add $t6, $t1, $t2
	sw $t3, 0($t5)
	sw $t4, 0($t6)
	li $t3, 2
	sll $t2, $t3, 2
	add $t3, $t2, $t0
	lw $t3, 0($t3)
	add $t4, $t2, $t1
	lw $t4, 0($t4)
	move $a0, $t3
	move $a1, $t4
	jal shiftXY
	move $t3, $v0
	move $t4, $v1
	add $t5, $t0, $t2
	add $t6, $t1, $t2
	sw $t3, 0($t5)
	sw $t4, 0($t6)
	la $t0, shiftDelay
	li $t1, 4
	sw $t1, 0($t0)
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra

shift_levels:
	la $t0, guyFloorCount
	lw $t0, 0($t0)
	la $t1, enemyX
	la $t2, enemyDirection
	addi $t3, $t0, -2
	sll $t3, $t3, 2
	add $t4, $t3, $t1
	lw $t4, 0($t4)
	add $t5, $t3, $t2
	lw $t5, 0($t5)
	move $a0, $t4
	move $a1, $t5
	jal shiftXY
	move $t4, $v0
	move $t5, $v1
	add $t6, $t1, $t3
	add $t7, $t2, $t3
	sw $t4, 0($t6)
	sw $t5, 0($t7)	
	addi $t3, $t0, -1
	sll $t3, $t3, 2
	add $t4, $t3, $t1
	lw $t4, 0($t4)
	add $t5, $t3, $t2
	lw $t5, 0($t5)
	move $a0, $t4
	move $a1, $t5
	jal shiftXY
	move $t4, $v0
	move $t5, $v1
	add $t6, $t1, $t3
	add $t7, $t2, $t3
	sw $t4, 0($t6)
	sw $t5, 0($t7)	
	addi $t3, $t0, 0
	sll $t3, $t3, 2
	add $t4, $t3, $t1
	lw $t4, 0($t4)
	add $t5, $t3, $t2
	lw $t5, 0($t5)
	move $a0, $t4
	move $a1, $t5
	jal shiftXY
	move $t4, $v0
	move $t5, $v1
	add $t6, $t1, $t3
	add $t7, $t2, $t3
	sw $t4, 0($t6)
	sw $t5, 0($t7)	
	la $t0, shiftDelay
	li $t1, 4
	sw $t1, 0($t0)
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra

shiftXY: 
	move $t5, $a0
	move $t6, $a1
	li $t7, 4
	beq $t5, $t7, switch
	li $t7, 54
	beq $t5, $t7, switch
	j enemy_step
switch:
	li $t7, -1
	mult $t6, $t7
	mflo $t6
	
enemy_step:
	add $t5, $t5, $t6
	move $v0, $t5
	move $v1, $t6
	jr $ra
	

drawEnemies:
	la $t0, guyFloorCount
	lw $t0, 0($t0)
	la $t1, guyDirection
	lw $t1, 0($t1)
	li $t1, 2
	ble $t0, $t1, level1_drawEnemies
	j shift_level_drawEnemies

level1_drawEnemies:
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	li $t0, 3
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	li $t0, 0
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal three_enemies_draw
	li $v0, 32
	li $a0, 40
	syscall
	li $t0, 3
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	li $t0, 0
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal three_enemies_restore
	lw $ra, 0($sp)
	addi $sp $sp, 4
	jr $ra

shift_level_drawEnemies:
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	la $t1, guyDirection
	lw $t1, 0($t1)
	li $t2, 1
	beq $t2, $t1, shift_level_down
	li $t2, -1
	beq $t2, $t1, shift_level_up
	beq $t1, $0, shift_level_exit

shift_level_down:
	la $t1, enemyX
	la $t2, enemyY
	addi $t3, $t0, -3
	sll $t3, $t3, 2
	add $t4, $t2, $t3
	add $t3, $t1, $t3
	lw $t3, 0($t3)
	lw $t4, 0($t4)
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	la $a0, SCREEN1
	li $a1, ENEMY_SIZE
	move $a2, $t3
	move $a3, $t4
	jal restoreEnemyAt
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	j shift_level_exit

shift_level_up:
	la $t1, enemyX
	la $t2, enemyY
	addi $t3, $t0, 1
	sll $t3, $t3, 2
	add $t4, $t2, $t3
	add $t3, $t1, $t3
	lw $t3, 0($t3)
	lw $t4, 0($t4)
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	la $a0, SCREEN1
	li $a1, ENEMY_SIZE
	move $a2, $t3
	move $a3, $t4
	jal restoreEnemyAt
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	j shift_level_exit
	
shift_level_exit:
	la $t0, guyFloorCount
	lw $t0, 0($t0)
	li $t1, 19
	li $t3, 1
	bne $t1, $t0, continue_shift_draw
	li $t3, 0
	
continue_shift_draw:
	add $t1, $t0, $t3
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	addi $t1, $t0, -2
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	jal three_enemies_draw
	li $v0, 32
	li $a0, 40
	syscall
	la $t0, guyFloorCount
	lw $t0, 0($t0)
	li $t1, 19
	li $t3, 1
	bne $t1, $t0, continue_shift_restore
	li $t3, 0

continue_shift_restore:
	add $t1, $t0, $t3
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	addi $t1, $t0, -2
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	jal three_enemies_restore
	lw $ra, 0($sp)
	add $sp, $sp, 4
	jr $ra

three_enemies_draw:
	lw $t0, 0($sp)
	lw $t1, 4($sp)
	addi $sp, $sp, 8
	la $t2, enemyX
	la $t3, enemyY
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
loop_draw:	
	bge $t0, $t1, exit_threeEnemies_draw
	sll $t4, $t0, 2
	add $t5, $t2, $t4
	add $t6, $t3, $t4
	lw $t7, 0($t5)
	lw $t8, 0($t6)
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	addi $sp, $sp, -4
	sw $t2, 0($sp)
	addi $sp, $sp, -4
	sw $t3, 0($sp)
	la $a0, SNAKE
	li $a1, ENEMY_SIZE
	move $a2, $t7
	move $a3, $t8
	jal drawEnemyAt
	lw $t3, 0($sp)
	lw $t2, 4($sp)
	lw $t1, 8($sp)
	lw $t0, 12($sp)
	addi $sp, $sp, 16
	addi $t0, $t0, 1
	j loop_draw
	
exit_threeEnemies_draw:
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
three_enemies_restore:
	lw $t0, 0($sp)
	lw $t1, 4($sp)
	addi $sp, $sp, 8
	la $t2, enemyX
	la $t3, enemyY
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
loop_threeEnemies_restore:	
	bge $t0, $t1, exit_threeEnemies_restore
	sll $t4, $t0, 2
	add $t5, $t2, $t4
	add $t6, $t3, $t4
	lw $s5, 0($t5)
	lw $s6, 0($t6)
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	addi $sp, $sp, -4
	sw $t2, 0($sp)
	addi $sp, $sp, -4
	sw $t3, 0($sp)
	la $a0, SCREEN1
	li $a1, ENEMY_SIZE
	move $a2, $s5
	move $a3, $s6
	jal restoreEnemyAt
	lw $t3, 0($sp)
	lw $t2, 4($sp)
	lw $t1, 8($sp)
	lw $t0, 12($sp)
	addi $sp, $sp, 16
	addi $t0, $t0, 1
	j loop_threeEnemies_restore	
	
exit_threeEnemies_restore:
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra

key_happened:
	lw $t2, 4($t9)
	beq $t2, 0x61, handle_a_left
	beq $t2, 0x64, handle_d_right
	beq $t2, 0x78, handle_x_down
	beq $t2, 0x77, handle_w_up
	beq $t2, 0x70, handle_p_quit
	j main_loop
	
handle_w_up:	
	addi $t0, $s2, -252
	lw $t0, 0($t0)
	beq $t0, LADDER, next_w
	addi $t0, $s2, -248
	lw $t0, 0($t0)
	beq $t0, LADDER, next_w
	addi $t0, $s2, -508
	lw $t0, 0($t0)
	beq $t0, WALL, skip_w
	addi $t0, $s2, -504
	lw $t0, 0($t0)
	beq $t0, WALL, skip_w
	j next_w
	
next_w:	### Go up ###
	addi $s1, $s1, -1 
	la $t0, guyFloorChange
	lw $t1, 0($t0)
	addi $t1, $t1, -1
	sw $t1, 0($t0)
	
skip_w: j main_loop

handle_d_right:
	addi $t0, $s3, 8
	lw $t0, 0($t0)
	beq $t0, WEB, shift_d
	addi $t0, $s3, 12
	lw $t0, 0($t0)
	beq $t0, WEB, shift_d
	addi $t0, $s3, -4
	lw $t0, 0($t0)
	beq $t0, WEB, shift_d
	addi $t0, $s3, -8
	lw $t0, 0($t0)
	beq $t0, WEB, shift_d
	addi $t0, $s3, 256
	lw $t0, 0($t0)
	beq $t0, WALL, next_d
	addi $t0, $s3, 260
	lw $t0, 0($t0)
	beq $t0, WALL, next_d
	j skip_d
next_d:
	addi $t0, $s2, 12
	lw $t0, 0($t0)
	beq $t0, WALL, skip_d
	addi $t0, $s2, 16
	lw $t0, 0($t0)
	beq $t0, WALL, shift_d
	li $t0, 2
	j continue_d
	
shift_d: li $t0, 1

continue_d: ### Go right ###
	add $s0, $s0, $t0
	
skip_d:	j main_loop

	
handle_a_left:
	addi $t0, $s3, -8
	lw $t0, 0($t0)
	beq $t0, WEB, shift_a
	addi $t0, $s3, -12
	lw $t0, 0($t0)
	beq $t0, WEB, shift_a
	addi $t0, $s3, 4
	lw $t0, 0($t0)
	beq $t0, WEB, shift_a
	addi $t0, $s3, 8
	lw $t0, 0($t0)
	beq $t0, WEB, shift_a
	addi $t0, $s3, 256
	lw $t0, 0($t0)
	beq $t0, WALL, next_a
	addi $t0, $s3, 260
	lw $t0, 0($t0)
	beq $t0, WALL, next_a
	j skip_a
next_a:
	addi $t0, $s2, -4
	lw $t0, 0($t0)
	beq $t0, WALL, skip_a
	addi $t0, $s2, -8
	lw $t0, 0($t0)
	beq $t0, WALL, shift_a
	li $t0, -2
	j continue_a
	
shift_a: li $t0, -1

continue_a: ### Go left ###
	add $s0, $s0, $t0
	
skip_a:	j main_loop

handle_x_down:
	addi $t0, $s3, 512
	lw $t0, 0($t0)
	beq $t0, LADDER, next_x
	addi $t0, $s3, 516
	lw $t0, 0($t0)
	beq $t0, LADDER, next_x
 	add $t0, $s3, 256
	lw $t0, 0($t0)
	beq $t0, WIN, game_over_win
	add $t0, $s3, 260
	lw $t0, 0($t0)
	beq $t0, WIN, game_over_win
	j skip_x
	
next_x:	### Go down ### 
	addi $s1, $s1, 1
	la $t0, guyFloorChange
	lw $t1, 0($t0)
	addi $t1, $t1, 1
	sw $t1, 0($t0)
	la $t0, guyDirection
	li $t1, 1
	sw $t1, 0($t0)
	
skip_x:	la $t0, guyDirection
	sw $0, 0($t0)
	j main_loop

handle_p_quit:	
	j resetValues



###### Draw character at start (x,y) facing right#######
drawGuyAt: 
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	addi $sp, $sp, -4
	sw $s1, 0($sp)
	addi $sp, $sp, -4
	sw $s0, 0($sp)
	
	jal getAddrXY
	
	lw $t1, 0($sp)
	addi $sp, $sp, 4
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
	addi $t1, $t1, BASE_ADDRESS
	move $s2, $t1	# save start address of guy at s2
	addi $s3, $t1, 772 # save left leg of guy address at s3
	
	move $t2, $a0	# ARRAY ADDR
	li $t3, 0
	move $t4, $a1	# num units
	li $t5, 0
loop_drawGuyAt: 
	beq $t3, $t4, done_drawGuyAt
	li $t9, 3
	beq $t3, $t9, newRow_drawGuyAt
	li $t9, 6
	beq $t3, $t9, newRow_drawGuyAt
	li $t9, 9
	beq $t3, $t9, newRow_drawGuyAt
cont_drawGuyAt:	
