game_over_win:

draw_win_screen:
	li $t0, BASE_ADDRESS      
        la $t1, WINSCREEN    
        li $t2, 0          
        li $t3, NUM_UNITS

loop_win_screen: 
	bge $t2, $t3, next_win
        sll $t4, $t2, 2         
        add $t5, $t1, $t4     
        lw $t5, 0($t5)       
        add $t4, $t4, $t0  
        sw $t5, 0($t4) 
        addi $t2, $t2, 1 
        j loop_win_screen
           
next_win:
	li $s0, startCursorX
	li $s1, startCursorY
 	
	la $a0,CURSOR
	li $a1,CURSOR_SIZE
	jal drawCursorAt
	
cursor_while_win:  
	la $a0, WINSCREEN
	li $a1, CURSOR_SIZE     
        jal restoreCursorAt
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	beq $t8, 1, key_happened_cursor_win
cursor_loop_win:
	la $a0, CURSOR
        li $a1, CURSOR_SIZE
 	jal drawCursorAt
 	li $v0, 32
	li $a0, 300
	syscall
	j cursor_while_win

key_happened_cursor_win:
	lw $t2, 4($t9)
	beq $t2, 0x61, handle_cursor_a_win
	beq $t2, 0x64, handle_cursor_d_win
	beq $t2, 0x78, handle_cursor_x_win
	beq $t2, 0x77, handle_cursor_w_win
	beq $t2, 0x73, handle_cursor_s_win
	j cursor_loop_win
	
handle_cursor_a_win:
	move $t0, $s2
	addi $t0, $t0, -8
	li $t1, LENGTH
	div $t0, $t1
	mfhi $t0
	beq $t0, $0, cursor_loop_win
	addi $s0, $s0, -3
	j cursor_loop_win
handle_cursor_d_win:
	move $t0, $s2
	addi $t0, $t0, 32
	li $t1, LENGTH
	div $t0, $t1
	mfhi $t0
	beq $t0, $0, cursor_loop_win
	addi $s0, $s0, 3
	j cursor_loop_win
handle_cursor_x_win:
	move $t0, $s2
	addi $t0, $t0, 2304
	li $t1, BASE_ADDRESS
	addi $t1, $t1, LAST_UNIT
	sub $t0, $t0, $t1
	bgt $t0, $0, cursor_loop_win
	addi $s1, $s1, 3
	j cursor_loop_win
handle_cursor_w_win:
	move $t0, $s2
	addi $t0, $t0, -512
	li $t1, BASE_ADDRESS
	sub $t0, $t0, $t1
	blt $t0, $0, cursor_loop_win
	addi $s1, $s1, -3
	j cursor_loop_win
handle_cursor_s_win:
	la $a0, WINSCREEN
	li $a1, CURSOR_SIZE     
        jal restoreCursorAt
	lw $t0, 0($s2)
	beq $t0, CURSOR_GREEN1, resetValues
	beq $t0, CURSOR_GREEN2, resetValues
	beq $t0, CURSOR_RED1, clear_screen_end
	beq $t0, CURSOR_RED2, clear_screen_end
	j cursor_loop_win


collision:
	la $a0, SCREEN1
	li $a1, GUY_SIZE       
        jal restoreGuyAt
        la $t0, guyFloorCount
	lw $t0, 0($t0)
	li $t1, 19
	li $t3, 1
	bne $t1, $t0, shift_restore
	li $t3, 0
	
shift_restore:
	add $t1, $t0, $t3
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	addi $t1, $t0, -2
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	jal three_enemies_restore
	la $a0, SCREEN1
	li $a1, 20
	jal restoreHeartAt
	la $t0, guyDirection
	lw $0, 0($t0)
	la $t0, guyFloorCount
	li $t1, 0
	sw $t1, 0($t0)
	la $t0, guyFloorChange
	li $t1, 0
	sw $t1, 0($t0)
	la $a0, COLLISION1
	li $a1, 25
	jal drawCollisionAt
	
	li $v0, 32
	li $a0, 400
	syscall
	
	la $a0, COLLISION2
	li $a1, 25
	jal drawCollisionAt
	
	li $v0, 32
	li $a0, 400
	syscall
	
	la $a0, COLLISION3
	li $a1, 25
	jal drawCollisionAt
	
	li $v0, 32
	li $a0, 600
	syscall
	
	la $a0, SCREEN1
	la $a1, 25
	jal restoreCollisionAt
	la $a0, COLLISION2
