	jal drawCollisionAt
	
	li $v0, 32
	li $a0, 400
	syscall
	
	la $a0, SCREEN1
	la $a1, 25
	jal restoreCollisionAt
	
	la $t0, heartCount
	lw $t0, 0($t0)
	beq $t0, $0, draw_lose_screen
	j restart_main
	
	
