	move $t0, $s2
	addi $t0, $t0, -8
	li $t1, LENGTH
	div $t0, $t1
	mfhi $t0
	beq $t0, $0, cursor_loop_lose
	addi $s0, $s0, -3
	j cursor_loop_lose
handle_cursor_d_lose:
	move $t0, $s2
	addi $t0, $t0, 32
	li $t1, LENGTH
	div $t0, $t1
	mfhi $t0
	beq $t0, $0, cursor_loop_lose
	addi $s0, $s0, 3
	j cursor_loop_lose
handle_cursor_x_lose:
	move $t0, $s2
	addi $t0, $t0, 2304
	li $t1, BASE_ADDRESS
	addi $t1, $t1, LAST_UNIT
	sub $t0, $t0, $t1
	bgt $t0, $0, cursor_loop_lose
	addi $s1, $s1, 3
	j cursor_loop_lose
handle_cursor_w_lose:
	move $t0, $s2
	addi $t0, $t0, -512
	li $t1, BASE_ADDRESS
	sub $t0, $t0, $t1
	blt $t0, $0, cursor_loop_lose
	addi $s1, $s1, -3
	j cursor_loop_lose
handle_cursor_s_lose:
	la $a0, LOSESCREEN
	li $a1, CURSOR_SIZE     
        jal restoreCursorAt
	lw $t0, 0($s2)
	beq $t0, CURSOR_GREEN1, resetValues
	beq $t0, CURSOR_GREEN2, resetValues
	beq $t0, CURSOR_RED1, clear_screen_end
	beq $t0, CURSOR_RED2, clear_screen_end
	j cursor_loop_lose
	
clear_screen_end: li $t0, BASE_ADDRESS
	li $t1, BLACK
	li $t2, 0
	li $t3, NUM_UNITS

clear_loop_end: bge $t2, $t3, exit_main
	sll $t4, $t2, 2
	add $t4, $t4, $t0
	sw $t1, 0($t4)
	addi $t2, $t2, 1
	j clear_loop_end

	
resetValues:
	la $t0, guyDirection
	lw $0, 0($t0)
	la $t0, guyFloorCount
	sw $0, 0($t0)
	la $t0, guyFloorChange
	sw $0, 0($t0)
	j draw_start_screen

	
